import React from 'react';

import Drawer from '@material-ui/core/Drawer';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';

const SideDrawer = (props) => {
    return (
        <Drawer
            anchor="right"  
            open={props.open}
            onClose={()=> props.onClose(false)}
        >
            <List component="nav" className="side_drawer">
                <ListItem button onClick={()=> console.log('Featured')} className="texto_drawer">
                Nuestros servicios
                </ListItem>

                <ListItem button onClick={()=> console.log('Venue NFO')} className="texto_drawer">
                Acerca de nosotros
                </ListItem>

                <ListItem button onClick={()=> console.log('Highlights')} className="texto_drawer">
                Contactanos
                </ListItem>

            </List> 
        </Drawer>
    );
};

export default SideDrawer;
